import React from 'react';

const OrderedProductsElement = (props) => {
    const {date, name, origin, amount, price}= props  
    return ( 
        <div className="orderedProductsElement">
            <div className="orderedProductsTableBody">
                <tbody>
                    <tr>
                        <td>date</td>
                    </tr>
                </tbody>
            </div>
        </div>
    )
}

export default OrderedProductsElement
